const Rxmq = require('./es5/component.js').default;

const multiChannel = Rxmq.channel('multitest');

multiChannel.observe('test#').subscribe((d) => console.log('#', d));
multiChannel.observe('test.#').subscribe((d) => console.log('.#', d));
multiChannel.observe('test.*').subscribe((d) => console.log('.*', d));
multiChannel.observe('test.one').subscribe((d) => console.log('one', d));

multiChannel.subject('test.one').next('1');
multiChannel.subject('test').next('t');
